import logo from './logo.svg';
import './App.css';

function App() {
  return (


    <div className="App">
      let myVariable = 45;
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <div>{myVariable}</div>
        <p>
          <h1 >
            ANISHA IS QUEEN OF IDIOTISM 
          </h1>


        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
